import { buildQueries } from "@testing-library/react";
import PropTypes from "prop-types";

const Header = (props) => {
  return (
    <header>
      <h1 style={headingStyle}>{props.orgName}</h1>
    </header>
  );
};

/* Optional. Does data type checking */
Header.propTypes = {
  orgName: PropTypes.string,
};

/* Its the default props arguments incase nothing is passed into the const Header */
Header.defaultProps = {
  orgName: "University of California, Berkeley",
};

/* CSS Styling */
const headingStyle = {
  background: "linear-gradient(45deg, #08194D 30%, #162855 90%)",
  boxShadow: "0 3px 5px 2px rgba(60, 75, 120, .3)",
  color: "#88682A",
  height: 72,
  padding: "0 30px",
};

export default Header;
